import React, { Component } from 'react'
import MediaPlayer from '../MediaPlayer/Media-Player'


class Results extends Component {
    constructor() {
        super();
        this.state = {
            results: ''
        }
        this.handleCli = this.handleChange.bind(this);
    }



    handleClick = (args) => {
        console.log('wtf')
    }

    render() {

        let renObjData = ''

        if (this.props.response) {
            renObjData = this.props.response.items.map(function (data, idx) {
                return ([
                    <li key={idx} onClick={handleClick()}>{data.snippet.title}</li>,
                ]);
            });
        }


        return (
            <div className="Results">
                Results
                {this.props.response && <div>
                    <MediaPlayer
                        videoId={this.props.response.items[1].id.videoId}
                    />
                </div>}
                    {this.props.response &&
                        <ul className="Suit_Results">
                            {renObjData}
                        </ul>}
            </div>
        )
    }

}

export default Results
